import React from 'react';
import { Container } from './styles';

interface TootltipProps {
  title: string;
}

const Tootltip: React.FC<TootltipProps> = ({ title, children }) => {
  return (
  <Container>
    {children}
    <span>{title}</span>

  </Container>);

}

export default Tootltip;
